import React from 'react';

const WineBar = ({key, name, display_name, display_address}) => {
    return (
        <div key={key}>
            <h1>{name}</h1>
            <p>{display_name}</p>
            <p>{display_address}</p>
        </div>
    );
};

export default WineBar;
